import React from "react";
import { v4 } from "uuid";
import blogs  from "./data/blogs";

const Blogs = () => {


  return blogs.length ? (
    <section>
      <ul>
        { blogs.map( blog => {
          return <li key={blog.id}>{blog.title}</li>;
        })}
      </ul>
    </section>
  ) : (
    <section>
      <p>No available blogs.</p>
    </section>
  );
}

export default Blogs;
